import React from 'react';
import './productList.css'
import ProductListItem from './productListitem'


function List(props) {

    return (
        <div className="list">
            {props.products.map((product, index) => {
                return  <div key={index} className="product">
                            <ProductListItem product={product} />
                        </div>
            })}
        </div>
    )
}

export default List
